const Latest = () => {
    return (
      <section className="Latest">
        <h1>Latest Memories</h1>
        <article className="Latest-Items">
          <ul className="Latest-Items-List">
            <li className="Latest-Items-List-Item">
              <img src="./images/Background.jpg" alt="Memory"/>
            </li>
            <li className="Latest-Items-List-Item">
              <img src="./images/Background.jpeg" alt="Memory"/>
            </li>
            <li className="Latest-Items-List-Item">
              <img src="./images/Background.jpeg" alt="Memory"/>
            </li>
          </ul>
        </article>
      </section>
  );
};
  
export default Latest;
